PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?actor ?actorLabel ?adultCount ?popularNonAdultCount WHERE {
  ?actor imdb:profession "actor" .
  OPTIONAL {
    ?actor rdfs:label ?actorLabel .
  }
  {
    SELECT ?actor ( COUNT( DISTINCT ?adultTitle ) AS ?adultCount ) WHERE {
      ?actor imdb:knownForTitle ?adultTitle .
      ?adultTitle imdb:isAdult true .
    }
    GROUP BY ?actor
  }
  {
    SELECT ?actor ( COUNT( DISTINCT ?nonAdultTitleFiltered ) AS ?popularNonAdultCount ) WHERE {
      ?actor imdb:knownForTitle ?nonAdultTitleFiltered .
      ?nonAdultTitleFiltered imdb:isAdult false ; imdb:numVotes ?votes .
      FILTER ( ?votes >= 100000 )
    }
    GROUP BY ?actor
  }
  FILTER ( ?adultCount >= 3 && ?popularNonAdultCount >= 1 )
}
ORDER BY DESC ( ?adultCount ) ?actorLabel

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?title ?titleLabel ?director ?directorLabel ?rating ?votes WHERE {
  ?title rdf:type imdb:Movie .
  FILTER NOT EXISTS {
    ?title imdb:parentTitle ?p
  }
  .
  FILTER NOT EXISTS {
    ?ep imdb:parentTitle ?title
  }
  .
  ?title imdb:numVotes ?votes .
  FILTER ( xsd:int ( ?votes ) >= 100000 ) .
  ?title imdb:averageRating ?rating .
  ?title imdb:director ?director .
  OPTIONAL {
    ?title rdfs:label ?titleLabel
  }
  OPTIONAL {
    ?director rdfs:label ?directorLabel
  }
  FILTER NOT EXISTS {
    ?other rdf:type imdb:Movie .
    FILTER NOT EXISTS {
      ?other imdb:parentTitle ?p2
    }
    .
    FILTER NOT EXISTS {
      ?ep2 imdb:parentTitle ?other
    }
    .
    ?other imdb:numVotes ?otherVotes .
    FILTER ( xsd:int ( ?otherVotes ) >= 100000 ) .
    ?other imdb:averageRating ?otherRating .
    ?other imdb:director ?director .
    FILTER ( xsd:decimal ( ?otherRating ) > xsd:decimal ( ?rating ) || ( xsd:decimal ( ?otherRating ) = xsd:decimal ( ?rating ) && xsd:int ( ?otherVotes ) > xsd:int ( ?votes ) ) )
  }
}
ORDER BY DESC ( xsd:decimal ( ?rating ) ) DESC ( xsd:int ( ?votes ) )
LIMIT 10

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX imdb_principal: <https://www.imdb.com/principal/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?title ?titleLabel ?actor ?actorLabel ?startYear ?birthYear ?age WHERE {
  ?title rdf:type imdb:Movie .
  ?title imdb:numVotes ?numVotes .
  FILTER ( ?numVotes >= 100000 ) .
  {
    ?title imdb_principal:actor ?actor .
  } UNION {
    ?title imdb_principal:actress ?actor .
  }
  ?title imdb:startYear ?startYear .
  ?actor imdb:birthYear ?birthYear .
  BIND( ( ?startYear - ?birthYear ) AS ?age ) OPTIONAL {
    ?title rdfs:label ?titleLabel
  }
  OPTIONAL {
    ?actor rdfs:label ?actorLabel
  }
}
ORDER BY DESC ( ?age )
LIMIT 100

PREFIX imdb: <https://www.imdb.com/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?director ?directorLabel ?birthYear ?movie WHERE {
  {
    SELECT ( MAX( xsd:integer ( ?by ) ) AS ?maxBy ) WHERE {
      ?m2 imdb:numVotes ?votes2 .
      FILTER ( xsd:integer ( ?votes2 ) > 1000000 ) .
      ?m2 imdb:director ?d2 .
      ?d2 imdb:birthYear ?by .
      ?m2 rdf:type imdb:Movie .
    }
  }
  ?movie imdb:numVotes ?votes .
  FILTER ( xsd:integer ( ?votes ) > 1000000 ) .
  ?movie imdb:director ?director .
  ?director imdb:birthYear ?birthYear .
  FILTER ( xsd:integer ( ?birthYear ) = ?maxBy ) .
  OPTIONAL {
    ?director rdfs:label ?directorLabel
  }
  ?movie rdf:type imdb:Movie .
}

PREFIX imdb_principal: <https://www.imdb.com/principal/>
PREFIX imdb_title: <https://www.imdb.com/title/>
SELECT ?actor WHERE {
  imdb_title:tt0111161 imdb_principal:actor ?actor
}

PREFIX imdb: <https://www.imdb.com/>
SELECT ?genre ( COUNT( DISTINCT ?title ) AS ?frequency ) ( AVG( ?rating ) AS ?avgRating ) WHERE {
  ?title imdb:genre ?genre .
  OPTIONAL {
    ?title imdb:averageRating ?rating .
  }
}
GROUP BY ?genre
ORDER BY DESC ( ?frequency )

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX imdb: <https://www.imdb.com/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?title ?titleLabel ?director ?directorLabel ?startYear ?birthYear ( ( xsd:int ( ?startYear ) - xsd:int ( ?birthYear ) ) AS ?age ) WHERE {
  ?title rdf:type imdb:Movie ; imdb:director ?director ; imdb:startYear ?startYear ; imdb:numVotes ?numVotes .
  ?director imdb:birthYear ?birthYear .
  FILTER ( ?numVotes >= 100000 ) OPTIONAL {
    ?title rdfs:label ?titleLabel
  }
  OPTIONAL {
    ?director rdfs:label ?directorLabel
  }
}
ORDER BY DESC ( ?age )
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb_title: <https://www.imdb.com/title/>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?episode ?episodeLabel ?season ?epnum ?rating WHERE {
  ?episode imdb:parentTitle imdb_title:tt0903747 .
  ?episode imdb:seasonNumber ?season .
  ?episode imdb:episodeNumber ?epnum .
  OPTIONAL {
    ?episode imdb:averageRating ?rating
  }
  OPTIONAL {
    ?episode rdfs:label ?episodeLabel
  }
  {
    SELECT ( MAX( ?s ) AS ?maxSeason ) WHERE {
      ?e imdb:parentTitle imdb_title:tt0903747 .
      ?e imdb:seasonNumber ?s .
    }
  }
  FILTER ( ?season = ?maxSeason )
}
ORDER BY DESC ( ?rating ) ?epnum
LIMIT 3
